// src/services/api.ts

import axios from 'axios';

const api = axios.create({
    baseURL: 'http://localhost:3000/api/v1', // Backend URL
});

export const uploadPhoto = (formData: FormData) => {
    return api.post('/photos/upload', formData);
};

// Ensure this function is defined and exported
export const submitFeedback = (feedback: { rating: number, comments: string }) => {
    return api.post('/feedback', feedback);
};
